import logo from './logo.svg';
import './App.css';
import axios from 'axios'
import React,{useEffect,useState} from 'react';

function App() {
  const [data,setData] = useState([]);

  useEffect(()=>{
    axios.get('http://localhost:5000/data')
    .then((res)=>{
      const getData = res.data;
      setData(getData)
    })
  })

  return (
    <div className="App">
      { data.map((x,index)=>{
        return <h1>{x.name}</h1>
      })}
    </div>
  );
}

export default App;
